import React, { Component } from 'react'
import { FaFreeCodeCamp } from "react-icons/fa";
export default class Form2 extends Component {
    
    state={
        items:["PHP/MYSQL","NODEJS/MONGODB","C#/SQLSERVER","JAVA/ORACLE"],
        icon:<FaFreeCodeCamp/>
    }

    render() {
        return (
            <div>
                 <form>
                     <h1><FaFreeCodeCamp/></h1>
                     <select>
                         {this.state.items.map(i=>{return <option>{this.state.icon} {i}</option>;})}
                     </select>
                 </form>
            </div>
        )
    }
}
